Patch Set 2: Code-Review-1

(1 comment)

In addition to an problem commented inline (inline comment is why i give a -1 here), I would like to write something more general, that you may or may not take under consideration.

I regret to say that in my opinion it is not a good direction to go. I think, that testing procedures should be as clear as possible and there should be no additional abstraction layers that hides asserts inside testing procedures.
Especially look at these lines: 

+ fmLink.smackSetLabel(testLabelAccess, SMACK_LABEL_ACCESS);
+ fmLink.smackSetLabel(testLabelExec, SMACK_LABEL_EXEC);
+ fm.smackGetLabel(testLabelAccess, SMACK_LABEL_ACCESS);
+ fm.smackGetLabel(testLabelExec, SMACK_LABEL_EXEC);
+ fmLink.smackGetLabel(testLabelAccess, SMACK_LABEL_ACCESS);
+ fmLink.smackGetLabel(testLabelExec, SMACK_LABEL_EXEC);

although being cute and clean on the surface, well written on high level of abstraction, so it is easy to write tests, in fact it make analysis harder to conduct if something goes wrong on tests.

When tests fail i have no idea what exactly is even being tested here, and on previously version of tests everything was delivered step by step without any jumps and calls.
I understand, that this is a good thing to do an abstraction layers on software, but in my oppinion tests are not the case.

If there were a huge function with repeating lines of code copy-pasted again and again it would be for me easier to find purpose of a assert fail. And tests purpose it to make it easy to find bugs in final software, and not make exellent written, memory non-demending and easy to be maintained testing code.

That is just my thoughts and you may just ignore my cry of despair.
